		public Metafile GetMetaFile()
		{
			//IL_0026: Unknown result type (might be due to invalid IL or missing references)
			//IL_002c: Expected O, but got Unknown
			//IL_0046: Unknown result type (might be due to invalid IL or missing references)
			//IL_004d: Expected O, but got Unknown
			//IL_0060: Unknown result type (might be due to invalid IL or missing references)
			//IL_006a: Expected O, but got Unknown
			Rectangle rectangle = new Rectangle(0, 0, ((Control)this).Width, ((Control)this).Height);
			Graphics val = ((Control)this).CreateGraphics();
			IntPtr hdc = val.GetHdc();
			Metafile val2 = new Metafile(hdc, rectangle, (MetafileFrameUnit)2);
			val.ReleaseHdc(hdc);
			val.Dispose();
			val = Graphics.FromImage((Image)(object)val2);
			Brush val3 = (Brush)new SolidBrush(base.BackColor);
			val.FillRectangle(val3, rectangle);
			val3.Dispose();
			PaintAll(new PaintEventArgs(val, rectangle));
			val.Dispose();
			return val2;
		}

		private void CreateLayoutPlugIn(object sender, UITypeEditorEventArgs e)
		{
