		protected override void DoPaint(PaintArgs p)
		{
			m_ObjectList.Clear();
			foreach (PlotObject dataView in DataViews)
			{
				m_ObjectList.Add(dataView);
			}
			foreach (PlotObject label in Labels)
			{
				m_ObjectList.Add(label);
			}
			foreach (PlotObject legend in Legends)
			{
				m_ObjectList.Add(legend);
			}
			foreach (PlotObject table in Tables)
			{
				m_ObjectList.Add(table);
			}
			foreach (PlotObject xAxis in XAxes)
			{
				m_ObjectList.Add(xAxis);
			}
			foreach (PlotObject yAxis in YAxes)
			{
				m_ObjectList.Add(yAxis);
			}
			foreach (PlotObject annotation in Annotations)
			{
				m_ObjectList.Add(annotation);
			}
			foreach (PlotObject dataCursor in DataCursors)
			{
				m_ObjectList.Add(dataCursor);
			}
			foreach (PlotObject limit in Limits)
			{
				m_ObjectList.Add(limit);
			}
			foreach (PlotChannelBase channel in Channels)
			{
				channel.LegendRectangle = Rectangle.Empty;
				m_ObjectList.Add(channel);
			}
			m_ObjectList.Sort(m_SorterLayer);
			m_LayoutManager.Execute(p, layoutDesign: false, p.DrawRectangle, p.DrawRectangle);
			GraphicsState gstate = p.Graphics.Save();
			p.Graphics.ResetTransform();
			if (Background.Visible)
			{
				p.Graphics.FillRectangle(I_Background.GetBrush(p, ((Control)this).ClientRectangle), ((Control)this).ClientRectangle);
			}
			p.Graphics.Restore(gstate);
			foreach (IPlotDraw @object in m_ObjectList)
			{
				@object.DrawSetup(p);
			}
			foreach (IPlotDraw object2 in m_ObjectList)
			{
				object2.UpdateCanDraw(p);
				object2.UpdateBoundsClip(p);
			}
			foreach (IPlotDraw object3 in m_ObjectList)
			{
				object3.DrawCalculations(p);
			}
			foreach (IPlotDraw object4 in m_ObjectList)
			{
				p.Graphics.ResetClip();
				object4.DrawBackgroundLayer1(p);
			}
			foreach (IPlotDraw object5 in m_ObjectList)
			{
				p.Graphics.ResetClip();
				object5.DrawBackgroundLayer2(p);
			}
			foreach (IPlotDraw object6 in m_ObjectList)
			{
				p.Graphics.ResetClip();
				object6.Draw(p);
			}
			foreach (IPlotDraw object7 in m_ObjectList)
			{
				p.Graphics.ResetClip();
				object7.DrawForeground(p);
			}
		}
	}
