		protected override void UpdateCanDraw(PaintArgs p)
		{
			//IL_0045: Unknown result type (might be due to invalid IL or missing references)
			//IL_0050: Unknown result type (might be due to invalid IL or missing references)
			base.UpdateCanDraw(p);
			m_CachedXAxis = XAxis;
			m_CachedYAxis = YAxis;
			if (m_CachedXAxis == null)
			{
				base.CanDraw = false;
			}
			else if (m_CachedYAxis == null)
			{
				base.CanDraw = false;
			}
			else if (m_CachedXAxis.DockOrientation == m_CachedYAxis.DockOrientation)
			{
				base.CanDraw = false;
			}
			else if (m_CachedXAxis.DockDataView == null)
			{
				base.CanDraw = false;
			}
			else if (m_CachedYAxis.DockDataView == null)
			{
				base.CanDraw = false;
			}
			else if (!m_CachedXAxis.DockDataView.Visible)
			{
				base.CanDraw = false;
			}
			else if (!m_CachedYAxis.DockDataView.Visible)
			{
				base.CanDraw = false;
			}
		}

		protected override void UpdateBoundsClip(PaintArgs p)
		{
			if (m_CachedXAxis == null || m_CachedYAxis == null)
			{
				return;
			}
			m_XYSwapped = m_CachedXAxis.DockHorizontal;
			int top = m_CachedYAxis.ScaleDisplay.PixelsMin;
			int bottom = m_CachedYAxis.ScaleDisplay.PixelsMax;
			int left = m_CachedXAxis.ScaleDisplay.PixelsMin;
			int right = m_CachedXAxis.ScaleDisplay.PixelsMax;
			if (ClippingStyle == PlotClippingStyle.DataView)
			{
				PlotDataView dockDataView = m_CachedYAxis.DockDataView;
				if (dockDataView != null)
				{
					if (!XYSwapped)
					{
						top = dockDataView.BoundsClip.Top;
						bottom = dockDataView.BoundsClip.Bottom;
					}
					else
					{
						top = dockDataView.BoundsClip.Left;
						bottom = dockDataView.BoundsClip.Right;
					}
				}
				dockDataView = m_CachedXAxis.DockDataView;
				if (dockDataView != null)
				{
					if (!XYSwapped)
					{
						left = dockDataView.BoundsClip.Left;
						right = dockDataView.BoundsClip.Right;
					}
					else
					{
						left = dockDataView.BoundsClip.Top;
						right = dockDataView.BoundsClip.Bottom;
					}
				}
			}
			base.BoundsClip = iRectangle.FromLTRB(m_XYSwapped, left, top, right, bottom);
		}

		protected void SetClipRect(PaintArgs p)
		{
			if (base.BoundsClip != Rectangle.Empty)
			{
				Rectangle boundsClip = base.BoundsClip;
				Rectangle clip = new Rectangle(boundsClip.Left, boundsClip.Top, boundsClip.Width + 1, boundsClip.Height + 1);
				p.Graphics.SetClip(clip);
			}
		}

		protected override void Draw(PaintArgs p)
		{
			SetClipRect(p);
			Draw(p, m_CachedXAxis, m_CachedYAxis);
		}

		protected override void DrawForeground(PaintArgs p)
		{
			if (base.BoundsClip != Rectangle.Empty)
			{
				p.Graphics.SetClip(base.BoundsClip);
			}
			DrawForeground(p, m_CachedXAxis, m_CachedYAxis);
		}

		protected virtual void Draw(PaintArgs p, PlotXAxis xAxis, PlotYAxis yAxis)
		{
		}

		protected virtual void DrawForeground(PaintArgs p, PlotXAxis xAxis, PlotYAxis yAxis)
		{
		}
	}
