		protected override void InternalOnMouseLeft(MouseEventArgs e, bool shouldFocus)
		{
			base.InternalOnMouseLeft(e, shouldFocus);
			if (base.Enabled)
			{
				int num;
				int num2;
				if (base.XYSwapped)
				{
					num = e.Y;
					num2 = e.X;
				}
				else
				{
					num = e.X;
					num2 = e.Y;
				}
				m_MouseDownEditMode = GetEditMode(e);
				ControlBase.Cursor = GetCursor(m_MouseDownEditMode);
				m_MouseDownXPixels = num;
				m_MouseDownYPixels = num2;
				m_MouseDownUnitsX = ConvertPixelsToX(num);
				m_MouseDownUnitsY = ConvertPixelsToY(num2);
				m_MouseDownX = X;
				m_MouseDownY = Y;
				m_MouseDownLeft = Left;
				m_MouseDownTop = Top;
				m_MouseDownRight = Right;
				m_MouseDownBottom = Bottom;
				m_MouseDownHeight = HeightValue;
				m_MouseDownWidth = WidthValue;
				base.IsMouseActive = true;
				if (shouldFocus)
				{
					Focus();
				}
			}
		}

		protected override void InternalOnMouseMove(MouseEventArgs e)
		{
			int num;
			int num2;
			if (base.XYSwapped)
			{
				num = e.Y;
				num2 = e.X;
			}
			else
			{
				num = e.X;
				num2 = e.Y;
			}
			if (base.IsMouseActive)
			{
				if (m_MouseDownEditMode == EditMode.Move)
				{
					double delta = ConvertPixelsToX(num) - m_MouseDownUnitsX;
					double delta2 = ConvertPixelsToY(num2) - m_MouseDownUnitsY;
					DragX(m_MouseDownX, delta);
					DragY(m_MouseDownY, delta2);
				}
				else if (m_MouseDownEditMode != EditMode.None)
				{
					EditMode mouseDownEditMode = m_MouseDownEditMode;
					bool value;
					bool value2;
					bool value3;
					bool value4;
					if (!base.XYSwapped)
					{
						value = mouseDownEditMode == EditMode.Size6 || mouseDownEditMode == EditMode.Size7 || mouseDownEditMode == EditMode.Size0;
						value2 = mouseDownEditMode == EditMode.Size2 || mouseDownEditMode == EditMode.Size3 || mouseDownEditMode == EditMode.Size4;
						value3 = mouseDownEditMode == EditMode.Size0 || mouseDownEditMode == EditMode.Size1 || mouseDownEditMode == EditMode.Size2;
						value4 = mouseDownEditMode == EditMode.Size4 || mouseDownEditMode == EditMode.Size5 || mouseDownEditMode == EditMode.Size6;
					}
					else
					{
						value = mouseDownEditMode == EditMode.Size6 || mouseDownEditMode == EditMode.Size5 || mouseDownEditMode == EditMode.Size4;
						value2 = mouseDownEditMode == EditMode.Size0 || mouseDownEditMode == EditMode.Size1 || mouseDownEditMode == EditMode.Size2;
						value3 = mouseDownEditMode == EditMode.Size2 || mouseDownEditMode == EditMode.Size3 || mouseDownEditMode == EditMode.Size4;
						value4 = mouseDownEditMode == EditMode.Size0 || mouseDownEditMode == EditMode.Size7 || mouseDownEditMode == EditMode.Size6;
					}
					if (base.CachedXAxis.ScaleRange.Reverse)
					{
						Math2.Switch(ref value, ref value2);
					}
					if (base.CachedYAxis.ScaleRange.Reverse)
					{
						Math2.Switch(ref value4, ref value3);
					}
					int value5 = num - m_MouseDownXPixels;
					int value6 = num2 - m_MouseDownYPixels;
					if (value)
					{
						double num3 = ((!base.CachedXAxis.ScaleRange.Reverse) ? (m_MouseDownWidth - base.CachedXAxis.PixelSpanToValue(value5)) : (m_MouseDownWidth + base.CachedXAxis.PixelSpanToValue(value5)));
						if (num3 < 0.0)
						{
							return;
						}
						double value7 = m_MouseDownRight - num3 / 2.0;
						SetXAndWidth(GetXFromValueUnits(value7), GetWidthFromValueUnits(num3));
					}
					if (value2)
					{
						double num3 = ((!base.CachedXAxis.ScaleRange.Reverse) ? (m_MouseDownWidth + base.CachedXAxis.PixelSpanToValue(value5)) : (m_MouseDownWidth - base.CachedXAxis.PixelSpanToValue(value5)));
						if (num3 < 0.0)
						{
							return;
						}
						double value7 = m_MouseDownLeft + num3 / 2.0;
						SetXAndWidth(GetXFromValueUnits(value7), GetWidthFromValueUnits(num3));
					}
					if (value3)
					{
						double num4 = ((!base.CachedYAxis.ScaleRange.Reverse) ? (m_MouseDownHeight - base.CachedYAxis.PixelSpanToValue(value6)) : (m_MouseDownHeight + base.CachedYAxis.PixelSpanToValue(value6)));
						if (num4 < 0.0)
						{
							return;
						}
						double value8 = m_MouseDownBottom + num4 / 2.0;
						SetYAndHeight(GetYFromValueUnits(value8), GetHeightFromValueUnits(num4));
					}
					if (value4)
					{
						double num4 = ((!base.CachedYAxis.ScaleRange.Reverse) ? (m_MouseDownHeight + base.CachedYAxis.PixelSpanToValue(value6)) : (m_MouseDownHeight - base.CachedYAxis.PixelSpanToValue(value6)));
						if (num4 < 0.0)
						{
							return;
						}
						double value8 = m_MouseDownTop - num4 / 2.0;
						SetYAndHeight(GetYFromValueUnits(value8), GetHeightFromValueUnits(num4));
					}
				}
			}
			else if (base.Focused)
			{
				ControlBase.Cursor = GetCursor(GetEditMode(e));
			}
			base.InternalOnMouseMove(e);
		}

		protected override void InternalOnMouseUp(MouseEventArgs e)
		{
			base.InternalOnMouseUp(e);
			if (base.IsMouseActive)
			{
				base.Bounds.Contains(e.X, e.Y);
			}
		}

		protected override bool InternalHitTest(MouseEventArgs e)
		{
			if (m_ClickRegion == null)
			{
				return false;
			}
			if (base.Focused)
			{
				for (int i = 0; i < GrabHandles.Length; i++)
				{
					if (GrabHandles[i].Rectangle.Contains(e.X, e.Y))
					{
						return true;
					}
				}
			}
			return m_ClickRegion.IsVisible((float)e.X, (float)e.Y);
		}

		protected override Cursor InternalGetMouseCursor(MouseEventArgs e)
		{
			if (base.Plot == null)
			{
				return Cursors.Default;
			}
			return GetCursor(GetEditMode(e));
		}

		protected EditMode GetEditMode(MouseEventArgs e)
		{
			if (UserCanSize && GrabHandle0.Enabled && GrabHandle0.Rectangle.Contains(e.X, e.Y))
			{
				return EditMode.Size0;
			}
			if (UserCanSize && GrabHandle1.Enabled && GrabHandle1.Rectangle.Contains(e.X, e.Y))
			{
				return EditMode.Size1;
			}
			if (UserCanSize && GrabHandle2.Enabled && GrabHandle2.Rectangle.Contains(e.X, e.Y))
			{
				return EditMode.Size2;
			}
			if (UserCanSize && GrabHandle3.Enabled && GrabHandle3.Rectangle.Contains(e.X, e.Y))
			{
				return EditMode.Size3;
			}
			if (UserCanSize && GrabHandle4.Enabled && GrabHandle4.Rectangle.Contains(e.X, e.Y))
			{
				return EditMode.Size4;
			}
			if (UserCanSize && GrabHandle5.Enabled && GrabHandle5.Rectangle.Contains(e.X, e.Y))
			{
				return EditMode.Size5;
			}
			if (UserCanSize && GrabHandle6.Enabled && GrabHandle6.Rectangle.Contains(e.X, e.Y))
			{
				return EditMode.Size6;
			}
			if (UserCanSize && GrabHandle7.Enabled && GrabHandle7.Rectangle.Contains(e.X, e.Y))
			{
				return EditMode.Size7;
			}
			if (UserCanMove)
			{
				return EditMode.Move;
			}
			return EditMode.None;
		}

		protected Cursor GetCursor(EditMode editMode)
		{
			return (Cursor)(editMode switch
			{
				EditMode.Size0 => Cursors.SizeNWSE, 
				EditMode.Size1 => Cursors.SizeNS, 
				EditMode.Size2 => Cursors.SizeNESW, 
