			GrabHandle7.Rectangle = Rectangle.Empty;
			Point point = new Point(xAxis.ScaleDisplay.ValueToPixels(X), yAxis.ScaleDisplay.ValueToPixels(Y));
			GraphicsState gstate = p.Graphics.Save();
			p.Graphics.SmoothingMode = (SmoothingMode)4;
			p.Graphics.TranslateTransform(point.X, point.Y);
			p.Graphics.RotateTransform((float)Rotation);
			p.Graphics.TranslateTransform(-point.X, -point.Y);
			DrawCustom(p, xAxis, yAxis);
			p.Graphics.Restore(gstate);
			if (ClickRegion != null)
			{
				Rectangle bounds = Rectangle.Truncate(ClickRegion.GetBounds(p.Graphics.GraphicsMS));
				if (bounds.Width <= 0)
				{
					bounds = new Rectangle(bounds.Left - 2, bounds.Top, 4, bounds.Height);
					ClickRegion = new Region(bounds);
					base.Bounds = bounds;
				}
				else if (bounds.Height <= 0)
				{
					bounds = new Rectangle(bounds.Left, bounds.Top - 2, bounds.Width, 4);
					ClickRegion = new Region(bounds);
					base.Bounds = bounds;
				}
				else
				{
					base.Bounds = bounds;
				}
			}
		}

