	public abstract class PlotObjectCollectionBase : CollectionBase
	{
		private string m_BaseName;

		private bool m_InitialSetup;

		[DesignerSerializationVisibility(DesignerSerializationVisibility.Hidden)]
		[Browsable(false)]
		public string BaseName
		{
			get
			{
				return m_BaseName;
			}
			set
			{
				m_BaseName = value;
			}
		}

		public bool InitialSetup => m_InitialSetup;

		public PlotObjectCollectionBase()
			: base(null)
		{
			base.AllowEdit = true;
		}

		public PlotObjectCollectionBase(IComponentBase componentBase)
			: base(componentBase)
		{
			base.AllowEdit = true;
		}

		public void Sort(IComparer comparer)
		{
			base.InnerList.Sort(comparer);
		}

		protected PlotObject GetPlotObjectByName(string name)
		{
			if (name == null)
			{
				return null;
			}
			IEnumerator enumerator = GetEnumerator();
			try
			{
				while (enumerator.MoveNext())
				{
					PlotObject plotObject = (PlotObject)enumerator.Current;
					if (plotObject.Name != null && plotObject.Name.ToUpper() == name.ToUpper())
					{
						return plotObject;
					}
				}
			}
			finally
			{
				IDisposable disposable = enumerator as IDisposable;
				if (disposable != null)
				{
					disposable.Dispose();
				}
			}
			return null;
		}

		protected override void SetupObjectBeforeAmbientControlBaseConnection(object value)
		{
			base.SetupObjectBeforeAmbientControlBaseConnection(value);
			PlotObject plotObject = value as PlotObject;
			if (BaseName != null && plotObject.Name == Const.EmptyString)
			{
				m_InitialSetup = true;
				int num = 0;
				{
					IEnumerator enumerator = GetEnumerator();
					try
					{
						while (enumerator.MoveNext())
						{
							PlotObject plotObject2 = (PlotObject)enumerator.Current;
							if (plotObject2.Name.ToUpper().StartsWith(BaseName.ToUpper()))
							{
								string s = plotObject2.Name.Substring(BaseName.Length);
								if (double.TryParse(s, NumberStyles.AllowLeadingWhite | NumberStyles.AllowTrailingWhite, CultureInfo.InvariantCulture, out var result) && (int)result > num)
								{
									num = (int)result;
								}
							}
						}
					}
					finally
					{
						IDisposable disposable = enumerator as IDisposable;
						if (disposable != null)
						{
							disposable.Dispose();
						}
					}
				}
				plotObject.Name = BaseName + " " + Convert2.ToString(num + 1);
				plotObject.TitleText = (value as PlotObject).Name;
			}
			else
			{
				m_InitialSetup = false;
			}
		}

		protected override void OnInsertComplete(int index, object value)
		{
			(value as IPlotObject).Plot = base.ComponentBase as Plot;
			base.OnInsertComplete(index, value);
		}

		protected override void OnRemoveComplete(int index, object value)
		{
			(value as IPlotObject).Plot = null;
			base.OnRemoveComplete(index, value);
		}

		protected override void OnSetComplete(int index, object oldValue, object newValue)
		{
			if (oldValue != null)
			{
				(oldValue as IPlotObject).Plot = null;
			}
			if (newValue != null)
			{
				(newValue as IPlotObject).Plot = base.ComponentBase as Plot;
			}
			base.OnSetComplete(index, oldValue, newValue);
		}
	}
