			{
				if (Point1X != value)
				{
					double point2X = Point2X;
					Width = point2X - value;
					X = (point2X + value) / 2.0;
				}
			}
		}

		[Description("")]
		[DesignerSerializationVisibility(DesignerSerializationVisibility.Hidden)]
		public double Point2X
		{
			get
