				{
					double point1X = Point1X;
					Width = value - point1X;
					X = (point1X + value) / 2.0;
				}
			}
		}

		[Description("")]
		[DesignerSerializationVisibility(DesignerSerializationVisibility.Hidden)]
		public double Point1Y
		{
