				float num2;
				if (!base.XYSwapped)
				{
					num = base.WidthPixels;
					num2 = base.HeightPixels;
				}
				else
				{
					num = base.HeightPixels;
					num2 = base.WidthPixels;
				}
				float num3 = p.Graphics.MeasureString(Text, Font).Width;
				float num4 = Font.Height;
				float num5 = num / num3;
				float num6 = num2 / num4;
				num7 = ((!(num6 < num5)) ? (num / num3 * Font.Size) : (num2 / num4 * Font.Size));
			}
			else
			{
				num7 = Font.Size;
			}
			if (num7 <= 0f)
			{
				return;
			}
			Font font;
			if (Font.Size != num7)
			{
				if (m_DrawFont == null || m_DrawFont.Size != num7)
				{
					m_DrawFont = new Font(Font.FontFamily, num7);
