			}
			UpdateChannelList(plot);
			double num = double.PositiveInfinity;
			double num2 = double.NegativeInfinity;
			foreach (PlotChannelBase channel in m_ChannelList)
			{
				if (channel.Count > 1 && ((!(Axis is PlotXAxis)) ? channel.GetInViewMinMaxY(out var minY, out var maxY) : channel.GetInViewMinMaxX(out minY, out maxY)))
				{
					num = Math.Min(num, minY);
					num2 = Math.Max(num2, maxY);
				}
			}
			if (num == double.PositiveInfinity)
			{
				return;
			}
			if (num2 == num)
			{
				Axis.ScaleRange.Min = num2 - Axis.ScaleRange.Span / 2.0;
				return;
			}
			double num4;
