		{
			base.UpdateCanDraw(p);
			if ((!Markers.Visible || !Markers.Fill.Pen.Visible) && (!Markers.Visible || !Markers.Fill.Brush.Visible) && (!FillLow.Visible || !FillLow.Pen.Visible) && (!FillLow.Visible || !FillLow.Brush.Visible) && (!FillHigh.Visible || !FillHigh.Pen.Visible) && (!FillHigh.Visible || !FillHigh.Brush.Visible))
			{
				base.CanDraw = false;
			}
		}

		protected void DrawFill(PaintArgs p, PlotXAxis xAxis, PlotYAxis yAxis)
		{
			//IL_01c4: Unknown result type (might be due to invalid IL or missing references)
			//IL_01cb: Expected O, but got Unknown
