			if ((!FillHigh.Visible && !FillLow.Visible) || Count < 2)
			{
				return;
			}
			Point[] array = new Point[base.DrawPointCount + 2];
			int num = base.YAxis.ScaleDisplay.ValueToPixels(Reference);
			int num2 = num;
			int num3 = num;
			int num4 = xAxis.ScaleDisplay.ValueToPixels(GetX(IndexDrawStart));
			int num5 = xAxis.ScaleDisplay.ValueToPixels(GetX(IndexDrawStop));
			for (int i = IndexDrawStart; i <= IndexDrawStop; i++)
			{
				int num6 = xAxis.ScaleDisplay.ValueToPixels(GetX(i));
				int num7 = yAxis.ScaleDisplay.ValueToPixels(GetY(i));
				num2 = Math.Min(num2, num7);
				num3 = Math.Max(num3, num7);
				if (base.XYSwapped)
				{
					ref Point reference = ref array[i - IndexDrawStart];
					reference = new Point(num7, num6);
				}
				else
				{
					ref Point reference2 = ref array[i - IndexDrawStart];
					reference2 = new Point(num6, num7);
				}
			}
			if (base.XYSwapped)
			{
				ref Point reference3 = ref array[^2];
				reference3 = new Point(num, num5);
			}
			else
			{
				ref Point reference4 = ref array[^2];
				reference4 = new Point(num5, num);
			}
			if (base.XYSwapped)
			{
				ref Point reference5 = ref array[^1];
				reference5 = new Point(num, num4);
			}
			else
			{
				ref Point reference6 = ref array[^1];
				reference6 = new Point(num4, num);
