		public void AddIntensityArray(double y, double startX, double span, Array intensityArray)
		{
			if (intensityArray.Rank != 1)
			{
				throw new Exception("Array must be one-dimensional.");
			}
			Type elementType = intensityArray.GetType().GetElementType();
			int lowerBound = intensityArray.GetLowerBound(0);
			int upperBound = intensityArray.GetUpperBound(0);
			int num = upperBound - lowerBound + 1;
			if (num < 1)
			{
				throw new Exception("Intensity Array must have one or more elements.");
			}
			if (num == 1)
			{
				if ((object)elementType == typeof(double))
				{
					AddXY(startX, y, nullValue: false, emptyValue: false, (double)intensityArray.GetValue(lowerBound));
					return;
				}
				if ((object)elementType == typeof(float))
				{
					AddXY(startX, y, nullValue: false, emptyValue: false, (float)intensityArray.GetValue(lowerBound));
					return;
				}
				if ((object)elementType != typeof(int))
				{
					throw new Exception("Array data type must be of type double, float, or int.");
				}
				AddXY(startX, y, nullValue: false, emptyValue: false, (int)intensityArray.GetValue(lowerBound));
			}
			else if ((object)elementType == typeof(double))
			{
				for (int i = lowerBound; i <= upperBound; i++)
				{
					AddXY(startX + (double)(i - lowerBound) * span / (double)(num - 1), y, nullValue: false, emptyValue: false, (double)intensityArray.GetValue(i));
				}
			}
			else if ((object)elementType == typeof(float))
			{
				for (int j = lowerBound; j <= upperBound; j++)
				{
					AddXY(startX + (double)(j - lowerBound) * span / (double)(num - 1), y, nullValue: false, emptyValue: false, (float)intensityArray.GetValue(j));
				}
			}
			else
			{
				if ((object)elementType != typeof(int))
				{
					throw new Exception("Array data type must be of type double, float, or int.");
				}
				for (int k = lowerBound; k <= upperBound; k++)
				{
					AddXY(startX + (double)(k - lowerBound) * span / (double)(num - 1), y, nullValue: false, emptyValue: false, (int)intensityArray.GetValue(k));
				}
			}
		}

