		public void DeleteDataByLines(int numberOfLines)
		{
			//IL_0037: Unknown result type (might be due to invalid IL or missing references)
			//IL_0041: Expected O, but got Unknown
			if (numberOfLines >= 1)
			{
				if (numberOfLines > ImageYSamples)
				{
					throw new Exception("Number of lines deleted must less than or equal to the ImageYSamples value.");
				}
				int height = ImageYSamples - numberOfLines;
				Bitmap image = m_Image;
				m_Image = new Bitmap(ImageXSamples, ImageYSamples);
				if (image != null)
				{
					Graphics val = Graphics.FromImage((Image)(object)m_Image);
					Rectangle rectangle = new Rectangle(0, numberOfLines, ((Image)image).Width, height);
					Rectangle rectangle2 = new Rectangle(0, 0, ((Image)image).Width, height);
					val.DrawImage((Image)(object)image, rectangle2, rectangle, (GraphicsUnit)2);
					val.Dispose();
					((Image)image).Dispose();
				}
				m_ImageYMin += (double)numberOfLines / (double)ImageYSpanSamples * ImageYSpan;
			}
		}

		public void SlideImage(double yOffset)
		{
			//IL_0054: Unknown result type (might be due to invalid IL or missing references)
			//IL_005e: Expected O, but got Unknown
			//IL_0035: Unknown result type (might be due to invalid IL or missing references)
			//IL_003f: Expected O, but got Unknown
			int num = (int)Math.Round(yOffset / ImageYSpan * (double)ImageYSpanSamples);
			if (num < 1)
			{
				return;
			}
			if (num > ImageYSamples)
			{
				m_Image = new Bitmap(ImageXSamples, ImageYSamples);
				return;
			}
			Bitmap image = m_Image;
			m_Image = new Bitmap(ImageXSamples, ImageYSamples);
			if (image != null)
			{
				Graphics val = Graphics.FromImage((Image)(object)m_Image);
				Rectangle rectangle = new Rectangle(0, num, ((Image)image).Width, ImageYSamples - num);
				Rectangle rectangle2 = new Rectangle(0, 0, ((Image)image).Width, ImageYSamples - num);
				val.DrawImage((Image)(object)image, rectangle2, rectangle, (GraphicsUnit)2);
				val.Dispose();
				((Image)image).Dispose();
			}
			m_ImageYMin += yOffset;
		}

