		{
			get
			{
				return m_X;
			}
			set
			{
				if (m_X != value)
				{
					m_X = value;
					m_CH.DoDataChange();
				}
			}
		}

		public bool Null
		{
			get
			{
				return m_Null;
			}
			set
			{
				if (m_Null != value)
				{
					m_Null = value;
					m_CH.DoDataChange();
				}
			}
		}

