namespace Iocomp.Classes
{
	[Description("Plot Label Basic")]
	public class PlotLabelBasic : PlotLabelBase
	{
		private int m_LengthPixels;

		private int m_MarginOuterPixels;

		protected override PlugInStandard GetPlugIn()
		{
			return new PlotLabelBasicEditorPlugIn();
		}

		protected override string GetPlugInTitle()
		{
			return "Label Basic";
		}

		public PlotLabelBasic()
		{
			DoCreate();
		}

		protected override void SetDefaults()
		{
			base.SetDefaults();
			base.CanFocus = false;
			base.NameShort = "Basic";
		}

		protected override void InternalOnMouseLeft(MouseEventArgs e, bool shouldFocus)
		{
			if (shouldFocus)
			{
				Focus();
			}
		}

		protected override void CalculateDepthPixels(PaintArgs p)
		{
			m_MarginOuterPixels = (int)Math.Ceiling((double)p.Graphics.MeasureString(base.Font).Height * base.MarginOuter);
			Image image = GetImage();
			if (image == null)
			{
				Size requiredSize = ((ITextLayoutBase)base.TextLayout).GetRequiredSize(base.Text, base.Font, p.Graphics);
				if (!((!base.DockVertical) ? base.TextHorizontal : (!base.TextHorizontal)))
				{
					base.DockDepthPixels = requiredSize.Height + 2 * m_MarginOuterPixels;
					m_LengthPixels = requiredSize.Width + 2 * m_MarginOuterPixels;
				}
				else
				{
					base.DockDepthPixels = requiredSize.Width + 2 * m_MarginOuterPixels;
					m_LengthPixels = requiredSize.Height + 2 * m_MarginOuterPixels;
				}
			}
			else if (base.DockVertical)
			{
				base.DockDepthPixels = image.Height + 2 * m_MarginOuterPixels;
				m_LengthPixels = image.Width + 2 * m_MarginOuterPixels;
			}
			else
			{
				base.DockDepthPixels = image.Width + 2 * m_MarginOuterPixels;
				m_LengthPixels = image.Height + 2 * m_MarginOuterPixels;
			}
		}

		protected override void DrawCalculations(PaintArgs p)
		{
			CalculateBoundsAlignment(m_LengthPixels);
		}

		protected override void Draw(PaintArgs p)
		{
			//IL_0031: Unknown result type (might be due to invalid IL or missing references)
			//IL_0047: Unknown result type (might be due to invalid IL or missing references)
			I_Fill.Draw(p, base.BoundsAlignment);
			Image image = GetImage();
			if (image == null)
			{
				DrawStringFormat genericTypographic = DrawStringFormat.GenericTypographic;
				genericTypographic.Alignment = base.TextLayout.AlignmentHorizontal.Style;
				genericTypographic.LineAlignment = base.TextLayout.AlignmentVertical.Style;
				Rectangle rectangle = ((ITextLayoutBase)base.TextLayout).GetRectangle(base.BoundsAlignment, base.Font, p.Graphics);
				rectangle.Inflate(-m_MarginOuterPixels, -m_MarginOuterPixels);
				p.Graphics.DrawRotatedText(base.Text, base.Font, base.ForeColor, rectangle, base.ActualTextRotation, genericTypographic);
			}
			else
			{
				Point point = new Point(base.BoundsAlignment.Left + m_MarginOuterPixels, base.BoundsAlignment.Top + m_MarginOuterPixels);
				Rectangle rectangle = new Rectangle(point.X, point.Y, image.Width, image.Height);
				if (base.ImageTransparent)
				{
					p.Graphics.DrawImageTransparent(image, rectangle);
				}
				else
				{
					p.Graphics.DrawImage(image, point.X, point.Y);
				}
			}
		}

		protected override void DrawForeground(PaintArgs p)
		{
			if (base.Focused)
			{
				p.Graphics.DrawFocusRectangle(base.Bounds, base.BackColor);
			}
		}
	}
