	public class PlotLayoutSorterDockOrder : IComparer
	{
		int IComparer.Compare(object x, object y)
		{
			PlotLayoutBase plotLayoutBase = x as PlotLayoutBase;
			PlotLayoutBase plotLayoutBase2 = y as PlotLayoutBase;
			if (plotLayoutBase == null)
			{
				throw new Exception("x is not a PlotLayoutBase object");
			}
			if (plotLayoutBase2 == null)
			{
				throw new Exception("y is not a PlotLayoutBase object");
			}
			return plotLayoutBase.DockOrder.CompareTo((object?)plotLayoutBase2.DockOrder);
		}
	}
	public class PlotLayoutSorterOrientation : IComparer
	{
		int IComparer.Compare(object x, object y)
		{
			//IL_0079: Unknown result type (might be due to invalid IL or missing references)
			//IL_007f: Unknown result type (might be due to invalid IL or missing references)
			PlotLayoutBase plotLayoutBase = x as PlotLayoutBase;
			PlotLayoutBase plotLayoutBase2 = y as PlotLayoutBase;
			if (plotLayoutBase == null)
			{
				throw new Exception("x is not a PlotLayoutBase object");
			}
			if (plotLayoutBase2 == null)
			{
				throw new Exception("y is not a PlotLayoutBase object");
			}
			int num = ((!plotLayoutBase.DockRight && !plotLayoutBase.DockTop) ? (-plotLayoutBase.DockOrder) : (1000000 + plotLayoutBase.DockOrder));
			int num2 = ((!plotLayoutBase2.DockRight && !plotLayoutBase2.DockTop) ? (-plotLayoutBase2.DockOrder) : (1000000 + plotLayoutBase2.DockOrder));
			if (plotLayoutBase.DockOrientation != plotLayoutBase2.DockOrientation)
			{
				return 0;
			}
			return num.CompareTo((object?)num2);
		}
	}
