	[Description("Plot Legend Base.")]
	public abstract class PlotLegendBase : PlotLayoutFill
	{
		private double m_TitleMargin;

		private double m_Spacing;

		private PlotObjectCollection m_ChannelList;

		[Description("")]
		public double TitleMargin
		{
			get
			{
				return m_TitleMargin;
			}
			set
			{
				PropertyUpdateDefault("TitleMargin", value);
				if (TitleMargin != value)
				{
					m_TitleMargin = value;
					DoPropertyChange(this, "TitleMargin");
				}
			}
		}

		[Description("")]
		public double Spacing
		{
			get
			{
				return m_Spacing;
			}
			set
			{
				PropertyUpdateDefault("Spacing", value);
				if (Spacing != value)
				{
					m_Spacing = value;
					DoPropertyChange(this, "Spacing");
				}
			}
		}

		protected int ItemCount => m_ChannelList.Count;

		protected PlotObjectCollection Channels => m_ChannelList;

		protected override void CreateObjects()
		{
			base.CreateObjects();
			m_ChannelList = new PlotObjectCollection();
		}

		protected override void SetDefaults()
		{
			base.SetDefaults();
			DockSide = AlignmentQuadSide.Right;
			base.DockAutoSizeAlignment = PlotDockAutoSizeAlignment.Near;
			TitleMargin = 1.0;
			Spacing = 0.5;
		}

		private bool ShouldSerializeTitleMargin()
		{
			return PropertyShouldSerialize("TitleMargin");
		}

		private void ResetTitleMargin()
		{
			PropertyReset("TitleMargin");
		}

		private bool ShouldSerializeSpacing()
		{
			return PropertyShouldSerialize("Spacing");
		}

		private void ResetSpacing()
		{
			PropertyReset("Spacing");
		}

		protected override void InternalOnMouseLeft(MouseEventArgs e, bool shouldFocus)
		{
			if (shouldFocus)
			{
				Focus();
			}
		}

		protected void UpdateChannelList()
		{
			m_ChannelList.Clear();
			if (base.Plot == null)
			{
				return;
			}
			foreach (PlotChannelBase channel in base.Plot.Channels)
			{
				if (channel.VisibleInLegend && channel.LegendName.Trim().ToUpper() == base.Name.Trim().ToUpper())
				{
					m_ChannelList.Add(channel);
				}
			}
		}

		protected override void DrawForeground(PaintArgs p)
		{
			if (base.Focused)
			{
				p.Graphics.DrawFocusRectangle(base.Bounds, base.BackColor);
			}
		}
	}
