	[Description("Basic legend used to display a list of channels")]
	public class PlotLegendBasic : PlotLegendBase
	{
		private iRectangle m_Rect;

		private int m_MarginOuterPixels;

		private int m_RowHeightPixels;

		private int m_MarkerWidthPixels;

		private int m_TitleMarginPixels;

		private int m_LengthPixels;

		private int m_SpacingPixels;

		protected override PlugInStandard GetPlugIn()
		{
			return new PlotLegendBasicEditorPlugIn();
		}

		protected override string GetPlugInTitle()
		{
			return "Legend Basic";
		}

		public PlotLegendBasic()
		{
			DoCreate();
		}

		protected override void CreateObjects()
		{
			base.CreateObjects();
			m_Rect = new iRectangle();
		}

		protected override void SetDefaults()
		{
			base.SetDefaults();
			base.NameShort = "Basic";
		}

		protected override void CalculateDepthPixels(PaintArgs p)
		{
			UpdateChannelList();
			m_MarginOuterPixels = (int)Math.Ceiling((double)p.Graphics.MeasureString(base.Font).Height * base.MarginOuter);
			m_RowHeightPixels = p.Graphics.MeasureString(base.Font).Height;
			m_TitleMarginPixels = (int)Math.Ceiling((double)p.Graphics.MeasureString(base.Font).Width * base.TitleMargin);
			m_MarkerWidthPixels = m_RowHeightPixels;
			float num = 0f;
			if (base.DockHorizontal)
			{
				m_SpacingPixels = (int)Math.Ceiling((double)p.Graphics.MeasureString(base.Font).Height * base.Spacing);
				foreach (PlotChannelBase channel in base.Channels)
				{
					num = Math.Max(num, p.Graphics.MeasureString(channel.DisplayDescription, base.Font).Width);
				}
				m_LengthPixels = base.ItemCount * m_RowHeightPixels + (base.ItemCount - 1) * m_SpacingPixels;
				base.DockDepthPixels = (int)Math.Ceiling(num) + m_TitleMarginPixels + m_MarkerWidthPixels;
			}
			else
			{
				m_SpacingPixels = (int)Math.Ceiling((double)p.Graphics.MeasureString(base.Font).Width * base.Spacing);
				m_LengthPixels = 0;
				foreach (PlotChannelBase channel2 in base.Channels)
				{
					m_LengthPixels += p.Graphics.MeasureString(channel2.DisplayDescription, base.Font).Width;
				}
				m_LengthPixels += base.Channels.Count * (m_MarkerWidthPixels + m_TitleMarginPixels);
				if (base.Channels.Count > 1)
				{
					m_LengthPixels += (base.Channels.Count - 1) * m_SpacingPixels;
				}
				base.DockDepthPixels = m_RowHeightPixels;
			}
			m_LengthPixels += 2 * m_MarginOuterPixels;
			base.DockDepthPixels += 2 * m_MarginOuterPixels;
		}

		protected override void DrawCalculations(PaintArgs p)
		{
			CalculateBoundsAlignment(m_LengthPixels);
		}

		protected override void Draw(PaintArgs p)
		{
			I_Fill.Draw(p, base.BoundsAlignment);
			DrawStringFormat genericTypographic = DrawStringFormat.GenericTypographic;
			genericTypographic.Alignment = (StringAlignment)0;
			genericTypographic.LineAlignment = (StringAlignment)0;
			Brush brush = p.Graphics.Brush(base.ForeColor);
			m_Rect.Rectangle = base.BoundsAlignment;
			Rectangle rectangle;
			if (base.DockHorizontal)
			{
				m_Rect.Top = base.BoundsAlignment.Top + m_MarginOuterPixels;
				m_Rect.Height = m_RowHeightPixels;
				m_Rect.Width = m_MarkerWidthPixels;
				{
					foreach (PlotChannelBase channel in base.Channels)
					{
						string displayDescription = channel.DisplayDescription;
						Size size = p.Graphics.MeasureString(displayDescription, base.Font);
						rectangle = new Rectangle(base.BoundsAlignment.Left, m_Rect.Top, m_MarginOuterPixels + m_MarkerWidthPixels + m_TitleMarginPixels + size.Width, size.Height);
						rectangle.Inflate(1, 1);
						channel.LegendRectangle = rectangle;
						if (channel.Focused && !rectangle.IsEmpty)
						{
							p.Graphics.DrawFocusRectangle(rectangle, base.BackColor);
						}
						m_Rect.Left = base.BoundsAlignment.Left + m_MarginOuterPixels;
						((IPlotChannelBase)channel).DrawLegendMarker(p, m_Rect.Rectangle);
						m_Rect.Left += m_MarkerWidthPixels + m_TitleMarginPixels;
						p.Graphics.DrawString(displayDescription, base.Font, brush, m_Rect.Left, m_Rect.Top, genericTypographic);
						m_Rect.Top += m_SpacingPixels + m_RowHeightPixels;
					}
					return;
				}
			}
			m_Rect.Top = base.BoundsAlignment.Top + m_MarginOuterPixels;
			m_Rect.Left = base.BoundsAlignment.Left + m_MarginOuterPixels;
			m_Rect.Height = m_RowHeightPixels;
			m_Rect.Width = m_MarkerWidthPixels;
			foreach (PlotChannelBase channel2 in base.Channels)
			{
				string displayDescription = channel2.DisplayDescription;
				Size size = p.Graphics.MeasureString(displayDescription, base.Font);
				rectangle = new Rectangle(base.BoundsAlignment.Left, m_Rect.Top, m_MarginOuterPixels + m_MarkerWidthPixels + m_TitleMarginPixels + size.Width, size.Height);
				rectangle.Inflate(1, 1);
				channel2.LegendRectangle = rectangle;
				if (channel2.Focused && !rectangle.IsEmpty)
				{
					p.Graphics.DrawFocusRectangle(rectangle, base.BackColor);
				}
				((IPlotChannelBase)channel2).DrawLegendMarker(p, m_Rect.Rectangle);
				m_Rect.Left += m_MarkerWidthPixels + m_TitleMarginPixels;
				int width = p.Graphics.MeasureString(channel2.TitleText, base.Font).Width;
				p.Graphics.DrawString(displayDescription, base.Font, brush, m_Rect.Left, m_Rect.Top, genericTypographic);
				m_Rect.Left += width + m_SpacingPixels;
			}
		}
	}
}
