				val2 = new LinearGradientBrush(rectangle, Color.Orange, Color.Yellow, (LinearGradientMode)1);
			}
			else
			{
				val = new Bitmap(length, GradientWidth);
				rectangle = new Rectangle(0, 0, ((Image)val).Width, ((Image)val).Height);
				val2 = new LinearGradientBrush(rectangle, Color.Orange, Color.Yellow, (LinearGradientMode)0);
			}
			ColorBlend val3 = new ColorBlend();
			val3.Colors = m_Colors;
			val3.Positions = m_Positions;
			val2.InterpolationColors = val3;
			Graphics val4 = Graphics.FromImage((Image)(object)val);
			val4.FillRectangle((Brush)(object)val2, rectangle);
			val4.Dispose();
			((Brush)val2).Dispose();
