			for (int i = 0; i < m_Colors.Length - 1; i++)
			{
				int num = (int)(m_Positions[i] * (float)length);
				int num2 = (int)(m_Positions[i + 1] * (float)length);
				Rectangle rectangle = (swapped ? Rectangle.FromLTRB(num, 0, num2, GradientWidth - 1) : Rectangle.FromLTRB(0, num, GradientWidth - 1, num2));
