		public bool UserCanMove
		{
			get
			{
				return m_UserCanMove;
			}
			set
			{
				PropertyUpdateDefault("UserCanMove", value);
				if (UserCanMove != value)
				{
					m_UserCanMove = value;
					DoPropertyChange(this, "UserCanMove");
				}
			}
		}

		private Color SolidColor => Color;

		private Color HatchForeColor => Color;

