		{
			DoCreate();
		}

		protected override void SetDefaults()
		{
			base.SetDefaults();
			base.NameShort = "BandX";
			XStart = 40.0;
			XStop = 60.0;
		}

		private bool ShouldSerializeXStart()
		{
			return PropertyShouldSerialize("XStart");
		}

		private void ResetXStart()
		{
			PropertyReset("XStart");
		}

