		{
			PropertyReset("XStop");
		}

		protected override void InternalOnMouseLeft(MouseEventArgs e, bool shouldFocus)
		{
			if (shouldFocus)
			{
				Focus();
			}
			if (base.UserCanMove)
			{
				if (m_HitRectStart.Contains(e.X, e.Y))
				{
					m_MouseDownHitArea = PlotLimitBandHitArea.Start;
				}
				else if (m_HitRectStop.Contains(e.X, e.Y))
				{
