			//IL_0128: Invalid comparison between Unknown and I4
			if ((int)e.KeyCode == 37)
			{
				YReference -= base.YAxis.Span * 0.001;
			}
			else if ((int)e.KeyCode == 40)
			{
				YReference -= base.YAxis.Span * 0.001;
			}
			else if ((int)e.KeyCode == 39)
			{
				YReference += base.YAxis.Span * 0.001;
			}
			else if ((int)e.KeyCode == 38)
			{
				YReference += base.YAxis.Span * 0.001;
			}
			else if ((int)e.KeyCode == 33)
			{
				YReference += base.YAxis.ScaleDisplay.MajorIncrement;
			}
			else if ((int)e.KeyCode == 34)
			{
				YReference -= base.YAxis.ScaleDisplay.MajorIncrement;
			}
