			int num = yAxis.ValueToPixels(YReference);
			int dataViewXPixelsMin = GetDataViewXPixelsMin();
			int dataViewXPixelsMax = GetDataViewXPixelsMax();
			if (base.XYSwapped)
			{
				p.Graphics.DrawLine(pen, num, dataViewXPixelsMin, num, dataViewXPixelsMax);
			}
			else
