		private void DoZoomInOut(double factor)
		{
			bool flag = false;
			foreach (PlotAxis xAxis in Plot.XAxes)
			{
				if (xAxis.DockDataView != null && (xAxis.Focused || xAxis.DockDataView.Focused))
				{
