					break;
				}
			}
		}

		private void ToolBarAdapter_Changed(object sender, EventArgs e)
		{
			if (Plot == null)
			{
				return;
			}
			PlotToolBarAdapter toolBarAdapter = Plot.ToolBarAdapter;
			for (int i = 0; i < ((ToolBar)this).Buttons.Count; i++)
			{
				if (((ToolBar)this).Buttons[i] is PlotToolBarButton { Command: var command } plotToolBarButton)
				{
					if (command == PlotToolBarCommandStyle.TrackingResume)
					{
						((ToolBarButton)plotToolBarButton).Enabled = toolBarAdapter.AxesTrackingAnyDisabled;
					}
					if (command == PlotToolBarCommandStyle.TrackingPause)
					{
						((ToolBarButton)plotToolBarButton).Enabled = toolBarAdapter.AxesTrackingAnyEnabled;
					}
					if (command == PlotToolBarCommandStyle.AxesScroll)
					{
						((ToolBarButton)plotToolBarButton).Pushed = toolBarAdapter.AxisMouseMode == PlotAxisMouseMode.Scroll;
					}
					if (command == PlotToolBarCommandStyle.AxesZoom)
					{
						((ToolBarButton)plotToolBarButton).Pushed = toolBarAdapter.AxisMouseMode == PlotAxisMouseMode.Zoom;
					}
					if (command == PlotToolBarCommandStyle.Select)
					{
						((ToolBarButton)plotToolBarButton).Pushed = toolBarAdapter.DataViewMouseMode == PlotDataViewMouseMode.Select;
					}
					if (command == PlotToolBarCommandStyle.ZoomBox)
					{
						((ToolBarButton)plotToolBarButton).Pushed = toolBarAdapter.DataViewMouseMode == PlotDataViewMouseMode.ZoomBox;
					}
					if (command == PlotToolBarCommandStyle.DataCursor)
					{
						((ToolBarButton)plotToolBarButton).Pushed = toolBarAdapter.DataViewMouseMode == PlotDataViewMouseMode.DataCursor;
					}
				}
			}
		}
	}
